import React, { Component } from "react";

export class DataTable extends Component {
  render() {
    return (
      <table>
        <tr>
          <th>Name</th>
          <th>Age</th>
          <th>Eye color</th>

          <th>Gender</th>
          <th>company</th>
          <th>email</th>
          <th>phone</th>
          <th>address</th>
        </tr>
      </table>
    );
  }
}

export default DataTable;
